import React from 'react'
import styled from 'styled-components';
const Container = styled.div`
    height: 60px;
    
`
const Wrapper = styled.div`
 padding: 10px 20px;
 display:flex;
 justify-content:space-between;
`
const Home =styled.div`

`



const Navbar = () => {
    return (
       <Container>
           <Wrapper>
              <Home>
                  Home
              </Home>
           </Wrapper>
       </Container>
    )
}





export default Navbar
